import { useState } from 'react';
import '../styles/App.css';
import Form from './Form';

function App() {
  console.log('holis');

  const [person, setPerson] = useState({});

  return (
    <div className="App">
      <header className="App-header">
        <Form person={person} setperson={setPerson} />
      </header>
    </div>
  );
}

export default App;
